    POCO (Plain Old CLR Object) class that can be used to hold data corresponding

    to a row from the script_trace table.
  remarks: >-
    Please use this class instead of a full <xref href="SuperOffice.CRM.Rows.ScriptTraceRow" data-throw-if-not-resolved="false"></xref> object when

    you do not need to <b>create or update</b> a value in the database. Row objects have a large overhead

    since they carry the corresponding <xref href="SuperOffice.CRM.Data.ScriptTraceTableInfo" data-throw-if-not-resolved="false"></xref> object, which

    in turn defines fields and aliases; there may be a Sentry on a row, and various other helper objects.
